  const [hasbeenLoggedIn, setLogin] = useState(0);

  function displayUser() {
    const baseurl = "http://localhost:8080/api/userinfo";
    axios.get(baseurl, { withCredentials: true }).then((response) => {
      console.log(response);
    });
  }

  return (
    <React.Fragment>
      <Header hasbeenLoggedIn={hasbeenLoggedIn} />
      <Button onClick={this.displayUser}> Set Name</Button>
      <Button> get Name</Button>
